                    <th>Peso (kg)</th>
                    <th>Acciones</th>
                </tr>
            </thead>
            <tbody>
                {heroes.map(hero => (
                    <HeroItem key={hero._id} hero={hero} onDelete={onDeleteHero} onEdit={() => onEditHero(hero)} />
